import axios from 'axios'

const api = axios.create({
    baseURL: 'http://localhost:3000/api',
})

export const insertMovie = payload => api.post(`/ticket`, payload)
export const getAllMovies = () => api.get(`/ticket`)
export const updateMovieById = (id, payload) => api.put(`/ticket/${id}`, payload)
export const deleteMovieById = id => api.delete(`/ticket/${id}`)
export const getMovieById = id => api.get(`/ticket/${id}`)

const apis = {
    insertTicket,
    getAllTicket,
    updateTicketById,
    deleteTicketById,
    getTicketById,
}

export default apis
